const Div = ({ padding, dataResponse }) => {
  return (
    <div>
      <div>Tiempo: {dataResponse.obj[num]?.weather}</div>
      {dataResponse.obj[num]?.icon ? (
        <div>
          <img
            src={`http://openweathermap.org/img/wn/${dataResponse.obj[num]?.icon}@2x.png`}
          />
        </div>
      ) : null}
      <div style={{ padding: padding }}>Temperatura: {dataResponse.obj[num]?.temp}</div>
      <div style={{ padding: padding }}>
        Sensación Térmica: {dataResponse.obj[num]?.feels_like}
      </div>
      <div style={{ padding: padding }}>
        Temperatura Mínima: {dataResponse.obj[num]?.temp_min}
      </div>
      <div style={{ padding: padding }}>
        Temperatura Máxima: {dataResponse.obj[num]?.temp_max}
      </div>
      <div style={{ padding: padding }}>Presión: {dataResponse.obj[num]?.pressure}</div>
      <div style={{ padding: padding }}>Humedad: {dataResponse.obj[num]?.humidity}</div>
      <div style={{ padding: padding }}>Visibilidad: {dataResponse.obj[num]?.visibility}</div>
      <div style={{ padding: padding }}>
        Velocidad de viento: {dataResponse.obj[num]?.windSpeed}
      </div>
      <div style={{ padding: padding }}>Amanecer: {dataResponse.obj[num]?.sunrise}</div>
      <div style={{ padding: padding }}>Atardecer: {dataResponse.obj[num]?.sunset}</div>
    </div>
  );
};

export default Div
